import React from 'react';
import { XAxis } from 'recharts';

const XAxisWrapper = ({ dataKey, label, tickCount }) => {
  return <XAxis dataKey={dataKey} label={label} tickCount={tickCount} />;
};

export default XAxisWrapper;
